import React from "react";
import Encens from "../imgs./encens.jpeg";

const Hero = () => {
  return (
    <div className="hero-container">
      <img src={Encens} className="hero-img" alt="hero image" />
      <h1 className="hero-titme">Create Your Balance</h1>
    </div>
  );
};

export default Hero;
